import React, { useEffect, useState } from 'react';
import { Score } from './Score';
import axios from 'axios';

function MusicVisualiser() {
  const [noteData, setNoteData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/get_note_data');
        setNoteData(response.data.notes);
        console.log('Note data fetched:', response.data.notes);
      } catch (error) {
        console.error('Error fetching note data:', error);
      }
    };

    fetchData();
  }, []);

  return <Score staves={noteData} />;
}

export default MusicVisualiser;
